import React from 'react';
import { Canvas } from '@react-three/fiber';
import NetworkPoints from './NetworkPoint';

const NetworkAnimation = () => {
  return (
    <Canvas>
      <ambientLight />
      <pointLight position={[10, 10, 10]} />
      <NetworkPoints />
    </Canvas>
  );
};

export default NetworkAnimation;
